import {React} from 'react'
import NoteItem from "./NoteItem"

const NotesList = (props) => {

    const {notesList} = props

    return (
        <div>
        {notesList.length>0 && notesList.map(ele=>{
            return <NoteItem key={ele._id} noteTitle={ele.title} noteBody={ele.body}/>
        })}
        </div>
    )
}

export default NotesList
